const FeedbackOptions = ({ heandleGoodFeedback, heandleBadFeedback, heandleNeutralFeedback }) => {
    return (
        <div className="feedback">
            <button type="button" onClick={heandleGoodFeedback} className="feedback_btn">Good</button>
            <button type="button" onClick={heandleNeutralFeedback} className="feedback_btn">Neutral</button>
            <button type="button" onClick={heandleBadFeedback} className="feedback_btn">Bad </button>
        </div>
    )
}

export default FeedbackOptions;
